import React from 'react';
import axios from 'axios';
import styled from 'styled-components';
import ReactPaginate from 'react-paginate';

const TableContainer = styled.div`
    width: 100%;
`;

const LabelContainer = styled.div`
    width: 100%;
    display: flex;
`;

const Row = styled.div`
    width: 100%;
    display: flex;
`;

const Title = styled.div`
    width: 20%;
    margin: 20px;
`;
const Start = styled.div`
    width: 20%;
    margin: 20px;
`;
const End = styled.div`
    width: auto;
    margin: 20px;
`;

function MainPage() {

    const [events, setEvents] = React.useState([]);
    const [curPage, setCurPage] = React.useState(1);

    console.log('events: ', events);
    console.log('events length: ', events.length);

    React.useEffect(async () => {
            const getEvents = async () => {
                await axios.get(`https://mobile-app-interview.awair.is/events`)
                .then((response) => {
                    console.log('response:', response);
                    setEvents(response);
                })
                .catch((error) => {
                    console.log('error: ', error);
                });
            }
            if (events.length === 0) {
                getEvents();
            }
      }, [events]);

    return (
        <>
            <TableContainer>
                <LabelContainer>
                    <Title style={{ fontWeight: 'bold'}}>TITLE</Title>
                    <Start style={{ fontWeight: 'bold'}}>START</Start>
                    <End style={{ fontWeight: 'bold'}}>END</End>
                </LabelContainer>
                {
                    events.length != 0 ? events.data.events.map((index) => {
                        return (
                            <>
                            <Row>
                                <Title>{index.title === '' ? 'NO TITLE' : index.title}</Title>
                                <Start>{index.start}</Start>
                                <End>{index.end}</End>
                            </Row>
                            </>
                        );
                    })
                    :
                    null
                }
            </TableContainer>

            <ReactPaginate
                    previousLabel={"prev"}
                    nextLabel={"next"}
                    breakLabel={"..."}
                    pageCount={curPage}
                    marginPagesDisplayed={2}
                    pageRangeDisplayed={5}
                    containerClassName={"pagination"}
                    subContainerClassName={"pages pagination"}
                    activeClassName={"active"}/>
       </>
    );
}

export default MainPage;
